// src/App.js
import React from 'react';
import './App.css';
import SearchBar from './SearchBar';
import logo from './assets/images/logo.png'; // Importe o logo

const App = () => {
    return (
        <div style={{ textAlign: 'center', position: 'relative' }}>
            <img 
                src={logo} 
                alt="Logo da biblioteca" 
                style={{
                    position: 'absolute',
                    top: '10px',
                    right: '10px',
                    width: '50px', // Tamanho do logo
                    height: 'auto'
                }}
            />
            <h1 style={{ color: '#cedae1' }}>jeKlibrary</h1>
            <SearchBar />
        </div>
    );
};

export default App;
